Usage of $pull and $push together to modify arrays<p>Environment: MongoDB 5.0.2</p>
<p>Assuming the following collection:</p>
<pre class="lang-js prettyprint-override"><code>db.survey.drop();
db.survey.insertMany([
    {
        _id: 1,
        results: [
            { item: &quot;A&quot;, score: 5, great: 1 },
            { item: &quot;B&quot;, score: 8, great: 2 }
        ]
    },
    {
        _id: 2,
        results: [
            { item: &quot;C&quot;, score: 8, great: 2 },
            { item: &quot;B&quot;, score: 4, great: 3 }
        ]
    },
    {
        _id: 3,
        results: [
            { item: &quot;C&quot;, score: 8, great: 4  },
            { item: &quot;B&quot;, score: 4, great: 5  }
        ]
    }
]);
</code></pre>
<p>Now assume I want to change all elements of <code>results</code> which matching <code>item:&quot;B&quot;</code> and there I want to set the whole item to:</p>
<pre class="lang-js prettyprint-override"><code>{ item: &quot;B&quot;, score: 10, great: 10  }
</code></pre>
<p>I understand that I cannot use <a href="https://www.mongodb.com/docs/manual/reference/operator/update/addToSet/" rel="nofollow noreferrer"><code>$addToSet</code></a> because it can only match full documents.</p>
<p>I also understand that the following statement does not work either:</p>
<pre class="lang-js prettyprint-override"><code>db.survey.updateMany({}, {
    $pull: {
        results: { item: &quot;B&quot; }
    },
    $push: {
        results: { item: &quot;B&quot;, score: 10, great: 10  }
    }
})
</code></pre>
<p>...because it tells me that the combination of <a href="https://www.mongodb.com/docs/manual/reference/operator/update/pull/" rel="nofollow noreferrer"><code>$pull</code></a> and <a href="https://www.mongodb.com/docs/manual/reference/operator/update/push/" rel="nofollow noreferrer"><code>$push</code></a> on the same element does not work:</p>
<pre><code>Updating the path 'results' would create a conflict at 'results'
</code></pre>
<p>I understand that I can usually do this in 2 separate <code>updateMany</code> statement, but this violates the requirement of atomic updates, because it is not allowed that the element is in a response ever missing.</p>
<p>Is there an alternative which I missed so far?</p>

