Using the cursor in mongodb-rust sync<p>I took the code from the documentation, but it doesn't work.</p>
<pre class="lang-rust prettyprint-override"><code>pub fn get_countries(&amp;self) {
  let cursor = self.countries.find(None, None);
  for doc in cursor {
    println!(&quot;{}&quot;, doc?)
  }
}
</code></pre>
<p><code>mongodb::sync::Cursor&lt;bson::Document&gt; doesn't implement std::fmt::Display</code></p>
<p><code>mongodb::sync::Cursor&lt;bson::Document&gt; cannot be formatted with the default formatter</code></p>
<p><code>the ? operator can only be applied to values that implement std::ops::Try</code></p>
<p><code>the ? operator cannot be applied to type mongodb::sync::Cursor&lt;bson::Document&gt;</code></p>
<p>Also the cursor.collect() does not work correctly.</p>
<blockquote>
<p>the method <code>collect</code> exists for enum <code>std::result::Result&lt;mongodb::sync::Cursor&lt;bson::Document&gt;, mongodb::error::Error&gt;</code>, but its trait bounds were not satisfied</p>
<p>method cannot be called on <code>std::result::Result&lt;mongodb::sync::Cursor&lt;bson::Document&gt;, mongodb::error::Error&gt;</code> due to unsatisfied trait bounds</p>
</blockquote>
<p>I tried using cursor.iter() or cursor.into_iter(), the result was the same</p>
<p>Full code of module</p>
<pre class="lang-rust prettyprint-override"><code>use bson::Document;
use mongodb::{
  error::Error,
  sync::{ Collection, Database},
};

pub struct Core {
  db: Database,
  countries: Collection&lt;Document&gt;,
}

impl Core {
  pub fn new(db: &amp;Database) -&gt; Core {
    Core {
      db: db.clone(),
      countries: db.collection(&quot;countries&quot;),
    }
  }
  pub fn get_country(&amp;self, name: &amp;String) -&gt; Result&lt;Option&lt;Document&gt;, Error&gt; {
    self.countries.find_one(bson::doc! { &quot;idc&quot;: name }, None)
  }
  pub fn get_countries(&amp;self) {
    let cursor = self.countries.find(None, None);
    for doc in cursor {
      println!(&quot;{}&quot;, doc?)
    }
  }
}
</code></pre>

