<p>Here is my code for an instance :</p>
<pre><code>const MongoClient = require(&quot;mongodb&quot;).MongoClient;

const client = new MongoClient(&quot;myUrl&quot;, {
  useNewUrlParser: true,
  useUnifiedTopology: true,
});

exports.myHttpMethod = functions.region(&quot;europe-west1&quot;).runWith({
  memory: &quot;128MB&quot;,
  timeoutSeconds: 20,
}).https.onCall((data, context) =&gt; {
  console.log(&quot;Data is: &quot;, data);
  client.connect(() =&gt; {
    const testCollection = client.db(&quot;myDB&quot;).collection(&quot;test&quot;);
    testCollection.insertOne(data);
  });
});
</code></pre>
<p>And i would like to avoid the <code>client.connect()</code> in each function call that seems to be really too much.</p>
<p>I would like to do something like this :</p>
<pre><code>const MongoClient = require(&quot;mongodb&quot;).MongoClient;

const client = await MongoClient.connect(&quot;myUrl&quot;, {
  useNewUrlParser: true,
  useUnifiedTopology: true,
});

const db = client.db(&quot;myDB&quot;);

exports.myHttpMethod = functions.region(&quot;europe-west1&quot;).runWith({
  memory: &quot;128MB&quot;,
  timeoutSeconds: 20,
}).https.onCall((data, context) =&gt; {
  console.log(&quot;Data is: &quot;, data);
  const testCollection = db.collection(&quot;test&quot;);
  testCollection.insertOne(data);
});
</code></pre>
<p>But i can't <code>await</code> like this.<br />
In my AWS Lambda functions (running in python) i have not this issue and i am able to connect only once per instance, so i guess there is an equivalent but i don't know much JS / Node JS.</p>

